    public close() {
        this.bsModalRef.hide();
        // this.router.navigate(['./home/boards']);
    }

    get qty() {
        return this.addProductForm.get(this.item.code);
    }

    public setQtyValue(code : string, value : number) {
        console.log('setQtyValue - code:' + code);
        console.log('this.addProductForm.controls.length:' + this.addProductForm.controls.length);
        if (this.addProductForm.controls.length) {
            console.log('this.addProductForm.controls[0].value:' + this.addProductForm.controls[0].value);
        }
        
        if (this.addProductForm.get(code)) {
            console.log('setQtyValue - setting qty to code:' + code + '-' + value);
            this.addProductForm.get(code).setValue(value);
        }
    }

    public getQtyValue(code : string) : number {
        console.log('getQtyValue - code:' + code);
        console.log('getqtyvalue - contains:' + this.addProductForm.contains(code));
        if (this.addProductForm.get(code)) {
            console.log('getQtyValue - found control with code:' + code + ' and the value is:' + this.addProductForm.get(code).value);
            return this.addProductForm.get(code).value;
        } else if (this.addProductForm.contains(code)) {
            console.log('getQtyValue - value:' + this.addProductForm.controls[code].value);
            return this.addProductForm.controls[code].value;
        }
        return 0;
    }

    Id(id: string, code: string): string {
        return id + '_' + code;
    }

    public getPrice(price : number) : string {
        if (price) {
            return price.toFixed(2);
        }
        return '0';
    }

    addOneProduct(code : string) {
        const q = this.getQtyValue(code);
        this.setQtyValue(code, q + 1);
        this.addProduct(code);
    }

    subOneProduct(code : string) {
        const q = this.getQtyValue(code);
        if (q === 0) {
            return;
        }
        this.setQtyValue(code, q - 1);
        this.addProduct(code);
    }

    addProduct(code : string) {

        if (environment && environment.oData) {
            const q = this.getQtyValue(code);
            console.log('addProduct - q:' + q);
            let productToBeAdded = null;
            this.items.forEach(i => {
                if (i.code === code) {
                    productToBeAdded = i;
                }
            })
            console.log('code:' + code + ',q:' + q);
            this.accountService.fetchToken().subscribe(
                response1 => {
                    if (response1.headers) {
                        const csrftoken : string = response1.headers.get('X-CSRF-Token');
                        if (csrftoken) {
                            if (q === 0) {
                                this.carrelloService.deleteFromCarrello(csrftoken, code).subscribe(d => {
                                    console.log('delete went fine');
                                    this.manageProducts.changeProduct(productToBeAdded,q);
                                },
                                error => {
                                    console.log('error delete:' + error);
                                });
                            } else {
                                const carrello : Carrello = new Carrello();
                                carrello.Matnr = code;
                                carrello.Menge = '' + q;
                                this.carrelloService.updateCart(csrftoken, carrello).subscribe(d => {
                                    console.log('update went fine');
                                    this.manageProducts.changeProduct(productToBeAdded,q);
                                },
                                error => {
                                    console.log('error update:' + error);
                                })
                            }
                            
                        }
                    }
                })
            ;
        } else {
            const q = this.qty.value;
        }
    }

